import styled from "@emotion/styled";
export const Container = styled.div`

  padding: 0 20px;

  @media (min-width: 767px) and (max-width: 1279.98px) {
    padding: 0 171px;
  }
  @media (min-width: 1280px) {
    padding: 0 171px;
  }
`;
